import React from "react";
import { Grid, TextField, InputLabel, Select, MenuItem, FormControl } from "@mui/material";
import { styled } from '@mui/system';  // For custom styling in MUI v5
import useForm from "./useForm";

// Use styled or sx prop instead of withStyles
const Root = styled('form')(({ theme }) => ({
    padding: theme.spacing(2),
    '& .MuiFormControl-root': {
        margin: theme.spacing(1, 0),
        width: '100%',
    },
}));

const formControlStyle = {
    minWidth: 230,
};

const menuProps = {
    PaperProps: {
        style: {
            maxHeight: 250,
            width: 250,
        },
    },
    getContentAnchorEl: null,
    anchorOrigin: {
        vertical: "bottom",
        horizontal: "left",
    },
    transformOrigin: {
        vertical: "top",
        horizontal: "left",
    },
};

const initialFieldValues = {
    fullName: '',
    mobile: '',
    email: '',
    age: '',
    bloodGroup: '',
    address: ''
};

const DCandidateForm = (props) => {
    const { values, setValues, handleInputChange } = useForm(initialFieldValues);

    return (
        <Root autoComplete="off" noValidate>
            <Grid container spacing={2}>
                <Grid item xs={6}>
                    <TextField
                        name="fullName"
                        variant="outlined"
                        label="Full Name"
                        value={values.fullName}
                        onChange={handleInputChange}
                        sx={{ width: '100%', marginBottom: 2 }}
                    />
                    <TextField
                        name="email"
                        variant="outlined"
                        label="Email"
                        value={values.email}
                        onChange={handleInputChange}
                        sx={{ width: '100%', marginBottom: 2 }}
                    />
                    <FormControl variant="outlined" sx={formControlStyle}>
                        <InputLabel id="blood-group-label">Blood Group</InputLabel>
                        <Select
                            labelId="blood-group-label"
                            name="bloodGroup"
                            value={values.bloodGroup}
                            onChange={handleInputChange}
                            label="Blood Group"
                            MenuProps={menuProps}
                        >
                            <MenuItem value="">
                                <em>Select Blood Group</em>
                            </MenuItem>
                            <MenuItem value="AB+">AB +ve</MenuItem>
                            <MenuItem value="AB-">AB -ve</MenuItem>
                            <MenuItem value="A+">A +ve</MenuItem>
                            <MenuItem value="A-">A -ve</MenuItem>
                            <MenuItem value="B+">B +ve</MenuItem>
                            <MenuItem value="B-">B -ve</MenuItem>
                            <MenuItem value="O+">O +ve</MenuItem>
                            <MenuItem value="O-">O -ve</MenuItem>
                        </Select>
                    </FormControl>
                </Grid>
                <Grid item xs={6}>
                    <TextField
                        name="mobile"
                        variant="outlined"
                        label="Mobile"
                        value={values.mobile}
                        onChange={handleInputChange}
                        sx={{ width: '100%', marginBottom: 2 }}
                    />
                    <TextField
                        name="age"
                        variant="outlined"
                        label="Age"
                        value={values.age}
                        onChange={handleInputChange}
                        sx={{ width: '100%', marginBottom: 2 }}
                    />
                    <TextField
                        name="address"
                        variant="outlined"
                        label="Address"
                        value={values.address}
                        onChange={handleInputChange}
                        sx={{ width: '100%', marginBottom: 2 }}
                    />
                </Grid>
            </Grid>
        </Root>
    );
};

export default DCandidateForm;
